create table states
(
    id              mediumint unsigned auto_increment
        primary key,
    iso2            varchar(255)       null,
    eng_name        varchar(255)       not null,
    chn_name        varchar(64)        null,
    country_id      mediumint unsigned not null,
    country_code    char(2)            not null,
    fips_code       varchar(255)       null,
    wiki_data_id    varchar(128)       null,
    is_delete       tinyint default 0  null,
    create_datetime datetime           null,
    create_by       varchar(64)        not null,
    update_datetime datetime           not null,
    update_by       varchar(64)        null,
    constraint country_region_final
        foreign key (country_id) references countries (id)
);

create index country_region
    on states (country_id);

